import React from "react";

import "./styles.scss";

const CustomButton = ({ children, isGoogleSignIn, inverted, ...props }) => (
  <button className={`${inverted ? "inverted" : ""} custom-button`} {...props}>
    {children}
  </button>
);

export default CustomButton;
